    //-1 用户取消订单 1 用户已打款
    function setchange(int _status)public {
        assert(_status == -1 || _status == 1);
        currency memory v = currencyIndex[msg.sender];
        assert(v.token_confirm ==0);
        assert(v.user == msg.sender && v.user_confirm ==0);

        if (_status == -1){
            //从索引中删除这条已取消订单
            if(users[v.index] == msg.sender){
                //运营商不用再次取消
                v.token_confirm = -1;
                //返还运营商冻结token
                //balances[owner]=balances[owner]+v.amount;
                users[v.index]=users[users.length-1];
                currencyIndex[users[users.length-1]].index = v.index;
                users.length -=1;
            }
        }
        v.user_confirm = _status;
        currencyIndex[msg.sender] = v;
    }
    //-1 运营商取消订单 1 运营商确认收款
    function subchange(uint256 _txid,int _status) public{
        assert(owner == msg.sender);
        address _user;
        _user = txidIndex[_txid];
        currency memory v = currencyIndex[_user];
        //订单还未被确认
        assert(v.user == _user && v.token_confirm ==0);

        //运营商取消订单
        if (_status == -1 ){

            assert(block.number>v.started+100);
            v.token_confirm = -1;

        }
        //运营商确认收款
        if (_status == 1){
            assert(balances[owner]>=v.amount);
            balances[owner] = balances[owner] - v.amount;
            balances[_user] = balances[_user] + v.amount;
            v.token_confirm = 1;
            //返还用户抵押
            //msg.sender.transfer(v.value);
        }
        //删除订单
        if(v.token_confirm !=0){
            currencyIndex[_user]=v;
            //从索引中删除这条已完成订单
            if(users[v.index] == _user){
                users[v.index]=users[users.length-1];
                currencyIndex[users[users.length-1]].index = v.index;
                users.length -=1;
            }
        }
        daemon(owner);
        daemon(_user);
        //currencys[]
    }
