    function joinTable(uint256 tableid, uint value) public returns(string ret) {

        balances[msg.sender] = balances[msg.sender].sub(value);
        balances[tableMgrAddr] = balances[tableMgrAddr].add(value);

        TableManage table = TableManage(tableMgrAddr);
        ret =table.join(tableid,msg.sender, value);
        if(keccak256(ret) != keccak256("")){
            return ret;
        }
        Transfer(msg.sender, tableMgrAddr, value);  // ERC20 transfer event
        return "";
    }
    function transferForTM(uint256 tableid,address from, address to, uint value) public returns(string ret){
        if(msg.sender != tableMgrAddr){
            return "非法tableManage";
        }
        if(balances[from] < value){
            return "用户余额不足";
        }


        balances[from] = balances[from].sub(value);
        balances[to] = balances[to].add(value);

        TableManage table = TableManage(to);
        ret = table.join(tableid,from, value);

        Transfer(from, to, value);  // ERC20 transfer event
        return ret;
    }

